tekst:
Eesti maaelu arengukava 2007–2013 (MAK) toetuste kasutamine on jõudnud viimase aastani. Käesolev aruanne kajastab eelneva perioodi tulemusi. Euroopa Komisjoni maaelu arengu komitee andis MAK 2007–2013 heakskiidu 29. novembril 2007, mil avanes võimalus kasutada ühise põllumajanduspoliitika ja maaelu arengu toetusi Maaelu Arengu Euroopa Põllumajandusfondist (EAFRD). MAKi raames on Eestil võimalik kasutada ligikaudu 925,2 mln eurot avaliku sektori toetusraha põllumajanduse ja maaelu arengu toetamiseks. Perioodil 2007–2013 rahastatakse EAFRD fondist 714,6 mln euro ning kaasfinantseeritakse Eesti riigi eelarvest 210,6 mln euro ulatuses.
MAKi meetmete rakendamine toimub Põllumajandusministeeriumi ja tema valitsemisala asutuste koostöös. Metsamajanduslikke meetmeid rakendatakse koostöös Keskkonnaministeeriumi valitsemisala asutustega. Meetmete rakendusüksus ja makseasutus on PRIA. Käesoleva aruandeperioodi lõpu 31.12.2012 seisuga on PRIA poolt rakendatud 1. telje kõik üheksa meedet koos peamiste alameetmetega. Samuti on rakendatud kaks 3. telje meedet koos alameetmetega ning Leader-meede. Programmperioodi viimasel aastal on planeeritud rakendada 1. telje kuue meetme puhul alameetmed piiratud mahus, 3. telje mitmekesistamise meede väga piiratud mahus ja Leader-meede. MAKi eelarve kasutamine ja toetuse määramine on jõudnud lõpusirgele. Projektide elluviimine on aktiivne ja viimasel aastal tuleb tähelepanu pöörata toetuse reaalsele kasutusele ning eelarvejääkide juhtimisele.
MAKi strateegilise lähenemisega seoses rakendatakse seire- ja hindamise süsteemi, mis on sätestatud Nõukogu määruse (EÜ) 1698/2005 artiklis 86. EMÜ majandus- ja sotsiaalinstituut on MAK perioodil 2007–2016 püsihindaja 1., 3. ja 4. telje raames. MAK 2007–2013 2. telje püsihindaja on Põllumajandusuuringute Keskus (PMK). Püsihindajad teevad omavahel koostööd, et hinnata telgede vahel tekkinud seoseid ja mõju ettevõtjatele. Püsihindaja pädevus on määratletud põllumajandusministri 21. märts 2011. a määrusega nr 26 „Eesti maaelu arengukava 2007–2013 seire ja hindamise kord“. Vastavalt korrale edastab Eesti Maaülikool Põllumajandusministeeriumile aruandeaastal rakendatud toetuste kohta aruandeaastale järgneva aasta 1. aprilliks seirearuande koostamiseks vajaliku teabe:
 ülevaade arengukava 1., 3. ja Leader-meetme toetustest, mis sisaldab andmeid tulemus- ja mõjunäitajate kohta, võttes arvesse arengukavas sätestatud eesmärke ning sisend- ja väljundnäitajaid;
 ülevaade 1., 3. ja Leader-meetme püsihindamisalastest tegevustest;
 vajaduse korral muu teave toetuste tõhusamaks rakendamiseks.
Püsihindamisel lähtutakse EL ühisest seire- ja hindamisraamistikust (CMEF- Common monitoring and evaluation framework). Lisaks on koostatud püsihindaja poolt andmete analüüsi metoodika.
 Püsihindamise tulemusena on võimalik iga-aastaselt juhtida abiraha paremat ärakasutamist programmi ning meetmete eesmärkidest lähtuvalt.
 Püsihindamisega tagatakse struktureeritud ülevaade toetuse saajatest ja kaasnevatest sotsiaalmajanduslikest näitajatest. Püsihindamise käigus kogutud andmete tulemused perioodil 2007–2012 võetakse kokku käesolevas aruandes. Püsihindamise tulemuste analüüsimisel lähtutakse maaelu arengu meetmete kolme põhieesmärgi täitmisest, milleks on:
 põllumajanduse ja metsanduse konkurentsivõime parandamine ümberkorraldamise, arendamise ja innovatsiooni toetamisega;
 keskkonna ja paikkonna parandamine maade hooldamise toetamisega;
 maapiirkondade elukvaliteedi parandamine ja majandustegevuse mitmekesistamise soodustamine.
Püsihindamine hõlmab kõiki MAK 2007–2013 1., 2., 3. telje ja Leader-meetme toetusi, mis on seotud põllumajanduse ja metsamajanduse konkurentsivõimega, maade hooldamise ja keskkonnaga, elukvaliteediga ja tegevuste mitmekesistamisega. Võetakse arvesse olukordade mitmekesisust, alates rahvastiku puuduse käes kannatavatest ääremaadel asuvatest maapiirkondadest ja lõpetades linnakeskuste suureneva surve all olevate maapiirkondadega.
Käesoleva aruande koostajad ja püsihindamise teostajad meetmete lõikes on:
Kersti Aro – meede 1.1, 1.3 ja Leader-meede;
Sirje Simmo – meede 1.2, 1.8, ja 1.9;
Jaana Prants – meede 1.6, 1.7 ja 3.2;
Risto Räisa – meede 1.4.1, 1.4.2, 1.4.3, 3.1 ja 2. telje kokkuvõte;
Mati Mõtte – meede 1.5.1, 1.5.2, 1.5.3, 1. telje kokkuvõte ja üldosa. Andmepäringute tegemine.
